import React, { Component } from "react";
import "./App.css";
import logo from "./assets/images/ssfulllogo.png";
import headerimg from "./assets/images/header.png"
import { Col, Row, Container, Navbar } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

class App extends Component {
  render() {
    return (
      <>
        <Navbar bg="light navbar-light">
          <Navbar.Brand href="/">
            <img
              src={logo}
              width="150"
              height="30"
              className="d-inline-block align-top"
              alt="SAVESTANCE"
            />
          </Navbar.Brand>
        </Navbar>
        <br />
        <Container>
          <Row>
            <Col>1 of 3</Col>
            <Col xs={9}><img src={headerimg} width="100%" alt="decoration"></img></Col>
            <Col>2 of 2</Col>
          </Row>
          <Row>
            <Col>2 of 3</Col>
            <Col>3 of 3</Col>
          </Row>
        </Container>
      </>
    );
  }
}

export default App;
